import moduleName from 'module'

class Story extends React.Component {

    static getInitialProps({ req, res, query }) {
        const storyId = query.id;
    }

    render() {
        return (
            <div>
                <h1>Story Page</h1>
            </div>
        )
    }
}
export default Story;
